Question: Below is the graph of $y = a \sin (bx + c) + d$ for some positive constants $a,$ $b,$ $c,$ and $d.$  Find the smallest possible value of $c.$

[asy]import TrigMacros;

size(400);

real f(real x)
{
	return 2*sin(3*x + pi) + 1;
}

draw(graph(f,-3*pi,3*pi,n=700,join=operator ..),red);
trig_axes(-3*pi,3*pi,-4,4,pi/2,1);
layer();
rm_trig_labels(-5,5, 2);

label("$1$", (0,1), E);
label("$2$", (0,2), E);
label("$3$", (0,3), E);
label("$-1$", (0,-1), E);
label("$-2$", (0,-2), E);
label("$-3$", (0,-3), E);
[/asy]
Response: From the graph, we can observe the following:
1. The amplitude of the sine wave is 2, so \(a = 2\).
2. The period of the sine wave is \(\frac{2\pi}{3}\), so \(b = 3\).
3. The midline of the sine wave is \(y = 1\), so \(d = 1\).
4. The phase shift can be determined by the horizontal shift of the sine wave. The sine wave starts at its minimum value at \(x = -\frac{\pi}{2}\), which corresponds to the phase shift \(-\frac{c}{b}\). Therefore, \(-\frac{c}{3} = -\frac{\pi}{2}\), so \(c = \frac{3\pi}{2}\).

The smallest possible value of \(c\) is \(\frac{3\pi}{2}\).
